import React from "react";
 
export default function RoundButton({border,radius,width,height,bgImg,bgColor}){
      
        return(
            <button style={{border:border,
                            borderRadius:radius,
                            width:width, 
                            height:height,
                            backgroundImage:'ur',
                            backgroundColor:bgColor,
                           }}
                            >
                        
            </button>
        )
}
